import React,{useRef} from 'react'

export default function Navbar() {


  
    return (
    <div className="navigation-top">
        <a href="/">Home</a>

        <a href="/">Destinations</a>

        <a href="/">Restaurants</a>

        <a href="/">Hotels</a>
        

      <a className="icon"><i className="fa fa-bars"></i></a>  

        <style jsx>{`
        
        .navigation-top{
            width:100%;
            height:100%;
            background-color:yellow
        }
        
        .navigation-top a{
            display: block;
            float:left;    
            text-align:center;
            text-decoration: none;
           
            padding:10px
        }

        

        .navigation-top .icon{
            display:none;
        }

        @media screen and (max-width:600px){

            .navigation-top a:not(:first-child){
                display:none
            }

            .navigation-top a.icon{
                display:block;
                float:right
            }
        }

       
        `}</style>
        </div>


    )
}
